    false,nt"url": null,nt"notes": "The California Pesticide Use Report data
    contains very detailed information across space and time. It is summarized by the
    following categories: 1) Individual pesticide chemical or groups of chemicals or
    all chemicals 2) Individual application site(crop) or group of sites(crops) or all
    sites(crops) 3) Individual county or all counties 4) Multiple years start from year
    1991 to year 2009, and it is continuously updated 5) Measures of pesticide usage
    by Gross Pounds, or pesticide application intensity by Application Rate (Pounds
    per Acre Treated), or by Acre Treated.",nt"license_title": null,nt"extras":
